import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Home = () => {
    return (
        <View style={styles.home_}>
            <View style={styles.home_box}>
                <View style={{ flex: '1', flexDirection: 'row', justifyContent: "space-between", padding: '20px' }}>
                    <Text style={styles.serviceStyle}>Services</Text>
                    <Text style={styles.btnStyle}>Show All</Text>
                </View>
                <View>two</View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    home_: {
        width: "100vw",
        height: '100vh',
        backgroundColor: "orange",
        display:'inline-block'
    },
    home_box: {
        width: '95vw',
        backgroundColor: "#fff",
        margin: 'auto',
        borderRadius:'5px',
    },
    serviceStyle: {
        color: "#102C56",
        fontSize: '19px',
        lineHeight: "14px",
        letterSpacing: '2%',
        fontWeight: 500
    },
    btnStyle: {
        color: "#F98700",
        fontSize: '17px',
        lineHeight: "18px",
        letterSpacing: '2%',
        fontWeight: 500
    }
})

export default Home;
